(3, 'test3', 1409.13, 204.73, '分析成功', '5.1 建设规模\n主要针对XXX五类用户：1）政府领导；2）政府主管部门；3）行业监管主体；4）行业监管客体；5）社会公众。\n5.2 建设方案\n5.2.1 “互联网+监管”数据中心建设\n建设“互联网+监管”数据中心，包括监管事项清单库、监管对象信息库、监管行为信息库、执法人员信息库、监管事项投诉举报信息库、风险预警信息库、知识库、双随机一公开计划信息库、联合监管信息库、信用信息库。\n5.2.1.1 监管数据中心定位\n依托“互联网+监管”平台建设，构建“互联网+监管”系统数据中心，利用挖掘、分析、计算和存储等基础支撑能力，为相关监管业务应用提供共享交换、查询检索、可视化展示和统计分析等数据服务，主要实现功能包括监管数据库设计、实施、管理以及监管数据共享服务内容。\n5.2.1.2 监管数据库设计\n5.2.1.2.1 数据设计原则\n（1）以需求为导向，以数据为基础。数据库的建设是以满足互联网+监管系统功能需求为主，即以满足数据的交换、共享、多角度查询处理为主，同时兼顾历史数据的清查整理。\n（2）统一规划，分步实施。数据库体系建设内容有轻重缓急之分，各项建设任务互相管理、互相影响。如果不经详细规划而轻率进行，势必因各项资源配备不足而导致混乱甚至返工。因此，必须将各项建设任务理出头绪，找出其中的规律，按照科学合理的节奏分步骤进行，才能充分保证数据库建设的有效性。\n（3）遵循标准，规范流程。统一规划下的分步实施必须有充分的标准化基础作保障。否则各单项任务建设后的集成工作难以进行。对于流程、数据、应用技术的标准化工作，应该在系统建设前进行；各应用系统除了遵循硬件平台、网络平台的支撑标准外，还应严格遵守流程、数据、应用技术标准，以保证系统间结合的流畅。\n（4）迭代法开发。采用迭代式的方法来开发和建设数据应用体系，即首先选择最核心的内容开发和部署一个满足最基本需求的功能原型。在原型的基础上根据反馈信息和业务的发展，不断总结经验，扩展数据源、不断丰富原型内容完善功能。\n5.2.1.2.2 监管事项清单库\n监管事项清单库数据从市级“政务信息资源共享服务平台”订阅获取，主要包括：认领关系表、监管事项检查实施清单、监管事项表、监管事项行政许可表、监管事项子项表等内容。\n5.2.1.2.3 监管对象信息库\n归集XXX监管对象目录清单，包括：分类监管目录、监管主体、监管客体；监管对象基础信息，包括：行政相对人（企业法人基本信息、个体工商户基本信息、社会团体法人基本信息、特定自然人信息）、行政相对人相关数据信息（企业法人、企业基本信息扩展、企业扩展信息、企业其他信息、个体工商户信息、个体工商户基本信息扩展）、农专社信息、其他（企业、个体工商户、农专社）信息；特种设备基础信息（电梯、锅炉等）、监管对象信息要素表等，形成监管对象信息。\n5.2.1.2.4 监管行为信息库\n归集XXX监管行为相关信息，主要包括：行政检查行为信息、行政处罚行为信息、行政强制行为信息以及其他监管行为信息。\n5.2.1.2.5 执法人员信息库\n归集XXX具有执法资格或受行政委托实施监管业务的人员信息，主要包括执法人员姓名、学历、联系电话、所属单位、执法区域、执法证号、有效期、执法类别和发证机关等。\n5.2.1.2.6 监管事项投诉举报信息库\n归集XXX涉及监管投诉举报业务的数据，并接收市级“互联网+监管\"系统推送的投诉举报信息，建立投诉举报信息库。投诉举报信息库主要包括投诉举报来源、类型、日期、对象、内容和处理结果等。\n5.2.1.2.7 风险预警信息库\n接收市级推送的风险预警信号，归集XXX各部门、各地方根据风险预警线索反馈数据表提供的数据，建立风险预警信号表、风险预警核查反馈表，通过研判分析形成风险预警信号进行风险预警核查结果推送。\n5.2.1.2.8 知识库\n\n归集知识库相关数据，主要包括法律法规库、案例库信息、预案库信息、风险特征库、规则信息库。其中法律法规库包含法律法规类型、法律法规名称、发布机关、发布文号、发布日期、施行日期等信息；案例库包含案例编号、部门类别、业务类别、监测事项、案例名称、案例简介、领域、起因、过程、处置等信息；预案库包含预案编号、事件级别、应急措施、应急资源、紧急类型、应急预案、应急机构、触发条件、所属行业等信息；风险特征库包含风险特征名称、业务归类、特征指标、关联关系等信息；规则信息库包含规则名称、领域、内容、目的、约束条件、适用范围等信息。\n5.2.1.2.9 双随机一公开计划信息库\n“双随机、一公开”计划信息库归集XXX各部门“双随机、一公开”计划信息和监管对象信息，建立“双随机、一公开”年度计划数据库、专项计划数据库以及对应抽查的监管对象信息库，并上报“双随机、一公开”年度计划和“双随机、一公开”专项计划至市级“互联网+监管”系统。\n5.2.1.2.10 联合监管信息库\n归集XXX各地区提供的联合监管信息数据，主要包括联合监管任务书数据表、联合监管检查对象数据表以及联合监管任务反馈关联数据表等。\n5.2.1.2.11 信用信息库\n归集XXX监管对象的信用信息，主要包括：严重违法企业信息、企业经营异常名录信息、个体经营异常状态信息、农专经营异常名录信息、经营异常公告详细信息、严重违法公告信息、行政处罚信息、工商部门行政处罚当事人信息、股权冻结被执行人信息、股权冻结详细信息等。\n5.2.2 服务界面和工作界面建设\n依托本区域现有的政务服务门户，构建“互联网+监管”系统服务界面，同步构建“互联网+监管”工作门户，面向领导同志、地方部门、社会公众提供信息展示、互动交流、数据推送、投诉举报等服务。\n5.2.2.1 服务界面\n“互联网+监管”系统服务界面主要依托区级政务服务门户，为社会公众提供多样化的服务渠道，为社会公众提供监管曝光台、监管应用、部门事项清单、监管动态、投诉举报、执法公示、法律法规等丰富的服务。打通线上线下监管投诉举报渠道，并提供受理反馈信息查询服务。社会公众的查询访问、投诉举报、评价监督等可作为本区域“互联网+监管”系统对XXX、部门监管工作的评判依据。\n5.2.2.1.1 监管曝光台\n展示曝光台信息列表并可以按部门和区域筛选。\n5.2.2.1.2 监管应用\n展示部门及区域监管综合服务。\n5.2.2.1.3 部门事项清单\n为社会公众提供监管事项查询服务，主要包括监管事项目录清单查询和监管事项实施清单。在服务界面提供显著的搜索栏，用户可输入相关监管事项的关键词进行数据查询，如：监管事项名称、发布部门等，便于公众学习和了解各部门的监管内容和监管职责。\n5.2.2.1.4 监管动态\n展示部门及区域监管动态并可以按部门和区域筛选。\n5.2.2.1.5 投诉举报\n为社会公众提供监管工作投诉举报入口，方便公众对监管工作、监管事件、监管处理结果等进行投诉。投诉举报内容具体包括投诉对象、投诉内容、投诉人联系方式等。\n5.2.2.1.6 执法公示\n展示监管行为信息库中执法结果公示信息，可以通过关键字查询、时间查询、按部门进行筛选。\n5.2.2.1.7 法律法规\n为公众提供法律法规查询功能，提供关键词查询、按类型筛选。\n5.2.2.2 工作界面\n“互联网+监管”系统工作界面为本区域领导同志、地区部门提供信息展示、互动交流、数据推送等服务\n具体功能包括：统一待办子系统、通知公告子系统、数据规范子系统、综合分析子系统、统一入口功能。本区域监管工作人员利用工作界面办理监管类业务的过程记录和痕迹数据可作为本区域“互联网+监管”系统对所辖地区、各部门监管效能评估评价的依据。\n5.2.2.2.1 首页\n首页支持免登陆访问。\n首页有国家和省、市“互联网+监管”系统的工作门户链接。\n5.2.2.2.2 用户中心\n为各业务子系统提供统一用户中心管理，包括用户管理、账户管理、角色管理、机构管理、权限管理等。系统的组织机构、用户体系与省“互联网+监管”系统工作门户保持一致。\n系统用户进行实名认证。\n系统与省“互联网+监管”系统工作门户实现单点登录。\n5.2.2.2.3 服务门户信息发布\n监管曝光台、监管动态等发布功能。\n5.2.2.2.4 统一待办子系统\n可以接收到“互联网+监管”所有子系统的待办数据。\n5.2.2.2.5 通知公告子系统\n展示通知公告信息并可以根据关键词进行筛选。\n5.2.2.2.6 数据规范子系统\n展示数据规范信息并可以根据关键词进行筛选。\n5.2.2.2.7 监管行为数据采集子系统\n对XXX监管行为相关信息进行采集，提供数据录入、编辑、删除等功能，并提供将录入监管行为信息库的相关结果数据与市平台进行上报的功能。\n5.2.2.2.8 综合分析子系统\n5.2.2.2.8.1 监管事项数据分析\n展示目录清单情况分析、检查实施清单情况分析的可视化图表。\n5.2.2.2.8.2 监管对象数据分析\n展示企业、个体工商户、农专 社、组织、个人、特种设备情况的可视化图表。\n5.2.2.2.8.3 行政执法监管数据分析\n展示监管任务情况分析、监管行为分布、检查方式分析等可视化图标。\n5.2.2.2.8.4 双随机、一公开数据分析\n展示计划完成情况、抽查情况、检查活动公开情况的可视化图表。\n5.2.2.2.8.5 投诉举报数据分析\n展示投诉举报概况分析、投诉举报来源、满意度情况、争议调解情况的可视化图表。\n5.2.2.2.9 统一入口\n通过在工作门户上建立统一入口，实现风险预警、监管数据中心、行政执法子系统的统一接入，按照登录角色进行各子系统访问权限设置。\n5.2.3 通用执法监管系统\n针对少量未建设监管系统的部门，提供通用的业务监管系统，作为这些部门运行监管事项的基础业务平台，实现对部门内部日常监管业务的全过程记录和管理。监管人员能够通过平台合理安排日常监管计划、记录监管过程、跟踪整改情况、实现监管数据归档，通过监管系统支撑，提高各部门日常监管服务的针对性、时效性和合理性。\n5.2.3.1 监管模型\n通用业务监管系统以监管事项库为运行基础，业务流程主要包括：编制监管计划、记录监管过程、跟踪整改落实、监管结果归档等步骤。如下图所示：\n 5.2.3.2 检查业务流程\n监管检查业务分为日常检查、飞行检查、专项检查、联合检查。\n1、日常检查\n2、飞行检查\n3、专项检查\n4、联合检查\n5.2.3.3 资源库子系统\n5.2.3.3.1 监管对象库\n同步上级平台的数据，同时提供监管对象的编辑，查询等相关功能，实现对监管对象统一维护和管理。\n5.2.3.3.2 执法人员库\n同步上级平台的数据，同时提供执法人员的创建，编辑，查询等相关功能，实现对执法人员统一维护和管理。\n5.2.3.3.3 专家库\n同步上级平台的数据，同时提供专家的创建，编辑，查询等相关功能，支持批量导入。\n5.2.3.3.4 监管事项库\n提供监管事项库获取、查询等相关功能。\n5.2.3.3.5 红黑库\n对企业红黑库数据进行维护。\n5.2.3.3.6 风险名单\n对企业风险名单数据进行维护。\n5.2.3.4 检查任务发起子系统\n5.2.3.4.1 日常检查\n管理日常监管任务。\n系统通过列表展示本部门已发起的所有任务，包括任务编号、任务名称、任务来源、检查日期、发起日期、当前状态等信息。\n系统支持任务新增功能，可以直接发起或保存草稿。\n在“线索接收”模块中发起任务时，任务来源采用默认设置，同时可关联线索中的有关信息，如监管事项、监管对象等。当选择任务类型为联合任务时，需要选择联合部门。\n选择监管事项：选择此任务关联的监管事项实施清单，可以多选，选择完成后在页面展示能够事项名称；选择监管对象抽取范围：支持选择监管对象抽取范围，支持按子库、按区域、按行业、按规模等进行筛选；抽取比例和抽取数量二选一，只能选填一个；选择执法人员抽取范围：支持选择执法人员抽取范围，支持按子库、按区域、按性别等进行筛选；设置抽取规则：从双随机规则中选择监管对象和执法人员抽取规则。\n在匹配抽取后生成监管对象和执法人员名单，生成后发起任务，执法人员在任务跟踪模块接收到自己的任务。\n5.2.3.4.2 其他来源检查\n围绕投诉举报、风险预警及专项检查内容，系统提供线索接收及检查任务发起功能。\n投诉举报\n能够接收来自投诉举报的线索信息，支持检查任务发起操作。\n能够按照投诉举报对象、类型、来源渠道、时间等条件进行搜索查看，能够查看监管投诉举报详情信息，包括投诉举报用户信息、举报详情信息。\n风险预警\n能够接收来自风险预警的线索信息，支持检查任务发起操作。\n能够按照风险预警线索名称、风险来源、风险等级、预警时间等条件进行搜索查看，能够查看风险预警详情信息。\n双随机\n能够接收来自双随机系统的线索信息，支持检查任务发起操作。\n能够按照双随机结果进行搜索查看，能够查看双随机任务的详情信息。\n突发事件\n能够接收来自专项检查的线索信息，支持检查任务发起操作。\n能够按照专项检查任务名称、发起部门名称、任务发起时间等条件进行搜索查看，能够查看专项检查任务详情信息。\n5.2.3.5 检查任务管理子系统\n5.2.3.5.1 检查任务追踪\n对任务进行接收、执法反馈。\n通过通用执法监管运行系统可对任务进行跟踪。\n系统支持分角色查看任务跟踪情况。\n5.2.3.5.1.1 待检查\n系统分角色支持待检查任务跟踪。如下：\n执法人员角色：展示所有待接收的任务，执法人员查看后进入检查中模块；\n部门领导角色：展示本部门所有待接收的任务。\n系统支持按任务来源、监管对象、检查日期、发起日期条件搜索待检查任务，提供任务列表信息查看，包括任务类型、任务来源、来源信息、监管事项、抽取机关、检查机关、抽取日期、检查日期、行政相对人及检查内容信息。\n5.2.3.5.1.2 检查中\n系统分角色支持检查中任务跟踪。如下：\n执法人员角色：展示所有检查中的任务，执法人员反馈并办结后进入已完成模块；\n部门领导角色：展示本部门所有检查中的任务。\n系统支持按任务来源、监管对象、检查日期、发起日期条件搜索检查中任务，提供任务列表信息查看，查看任务当前未反馈或是已反馈状态。\n对于已反馈状态的任务，可以查看检查详情、现场处罚登记信息。\n5.2.3.5.1.3 已完成\n系统分角色支持已完成任务跟踪。如下：\n执法人员角色：展示所有检查中的任务，执法人员反馈并办结后进入已完成模块；\n部门领导角色：展示本部门所有检查中的任务。\n系统支持按任务来源、监管对象、检查结果、检查日期条件搜索已完成任务，提供任务列表信息查看，能够查看已完成任务详情信息。 \n5.2.3.5.1.4 整改待复查\n展示本部门所有整改待复查的任务，所有人可以对复查的任务进行反馈，同时系统支持授权可见。\n系统支持按任务名称、任务来源、上次检查时间、应复查时间条件搜索整改待复查任务，提供任务列表信息查看，能够看到任务详情、历次检查信息及任务反馈信息内容。\n5.2.3.5.2 检查任务复查\n对上次检查需要整改复查的任务进行复查。\n5.2.3.5.3 随机检查任务\n通用执法检查员随机检查任务的录入。\n5.2.3.5.4 检查主题总览\n对所有的检查主题进行总览（基本信息、结果信息等）。\n5.2.3.5.5 检查任务总览\n对所有的检查任务进行总览（基本信息、结果信息等）。\n5.2.3.5.6 我登记的简易案件\n登记简易案件结果信息、查看登记的简易案件信息。\n5.2.3.5.7 检查任务审核\n对通用执法检查员检查任务和复查任务进行审核。\n5.2.3.5.8 行政执法审核\n对处罚、强制案件进行审核。支持查看、审核功能，可以按照任务来源、监管对象、检查结果、检查日期条件进行搜索，审核分为通过、不通过，支持符合意见反馈。\n5.2.3.6 行为采集子系统\n5.2.3.6.1 行政处罚\n直接录入导入行政处罚行为。\n5.2.3.6.2 行政强制\n直接录入导入行政强制行为。\n5.2.3.6.3 行政检查\n直接录入导入行政检查行为。\n5.2.3.6.4 其他行为\n直接录入导入其他行为。\n5.2.3.7 处罚强制子系统\n5.2.3.7.1 行政执法\n对录入的处罚行为进行审核，通过后对接具体执法部门进行转派。\n5.2.3.7.2 简易案件\n简易案件登记、审核，通过后对接具体执法部门进行转派。\n5.2.3.7.3 一般案件\n一般案件登记、审核，通过后对接具体执法部门进行转派。\n5.2.3.7.4 行政强制\n行政强制案件登记、审核，通过后对接具体执法部门进行转派。\n5.2.3.7.5 行政复议\n行政复议记录管理。\n5.2.3.7.6 行政诉讼\n行政诉讼记录管理。\n5.2.3.7.7 处罚案件总览\n对所有的处罚任务进行总览，如果来源是检查任务，也可以看到相关任务信息（基本信息、结果信息等）。\n5.2.3.7.8 强制案件总览\n对所有的强制任务进行总览，如果来源是检查任务，也可以看到相关任务信息（基本信息、结果信息等）。\n5.2.3.8 归档案件审核子系统\n监管事项办结完成后，将监管过程中产生的表格、音视频、图片、过程信息及结果信息等按照相关部门归档要求进行归档管理，供随时查阅。\n系统相关人员能够对归档的案件进行审核，审核无误后进行案件数据归档。\n5.2.3.9 超期预警子系统\n5.2.3.9.1 签收超期预警\n督办、查看执法人员任务签收超期预警。\n5.2.3.9.2 反馈超期预警\n督办、查看执法人员任务反馈超期预警。\n5.2.3.10 查询统计子系统\n5.2.3.10.1 综合分析\n对部门的日常监管活动进行统计、对部门的任务进行统计、对部门任务来源进行统计、对行政相对人进行统计。\n5.2.3.10.2 可视化分析\n按任务量、任务状态、任务来源、监管对象维度分析，监管大数据分析。\n5.2.3.10.3 监管大数据分析\n对市级“政务信息资源共享服务平台”中对监管数据进行大数据分析的相关分析结果进行展示。\n5.2.4 风险预警系统\n接收上级“互联网+监管”系统推送的风险预警线索，组织开展风险核查、处置工作，及时反馈相关结果。主要工作包括：\n（1）梳理本区监管部门的监管业务涉及的相关风险点，加强风险分析研判和预测预警，为本区开展重点监管，联合监管和精准监管提供支撑;\n（2）及时接收上级“互联网+监管”系统推送的风险预警线索;\n（3）针对上级“互联网+监管”系统推送的风险预警线索，组织或协调本区部门开展风险核查、处置工作；\n（4）及时将风险核查、处置结果反馈给上级“互联网+监管”系统。\n5.2.4.1 风险预警工作流程\n风险预警系统工作流程如下：\n （1）数据汇聚\n各设区市、部门通过上级“互联网+监管”系统或其他交换通道，定期将监管相关数据、投诉举报数据、互联网及第三方平台数据汇聚到上级“互联网+监管”系统。\n（2）风险识别\n上级监管部门的风险预警系统对汇聚数据进行关联、分类、聚类、机器学习等大数据分析，发现、识别其中的风险点和市场主体违法违规线索。\n（3）风险预测预警\n上级监管部门的风险预警系统根据风险评价指标体系，构建风险预警模型，生成风险预警线索。\n（4）风险预警线索推送\n上级“互联网+监管”系统根据风险预警线索推送规则，定期将风险预警线索推送至本区。\n（5）核查处置\n上级“互联网+监管”系统推送风险等级为高、较高的风险预警线索，接收线索后本区应组织开展核查、处置工作，及时排查风险隐患。\n上级“互联网+监管”系统推送的风险等级为一般、低的风险预警线索，接收线索后本区可以根据自身工作情况开展核查、处置。\n（6）结果反馈\n本区各级监管部门及时将核查、处置结果录入系统，反馈给上级“互联网+监管”系统。上级“互联网+监管”系统接收省各级监管部门反馈的核查、处置结果，用于模型优化、完善。\n5.2.4.2 风险预警任务管理子系统\n对省平台下发的任务进行核查处置，向省平台反馈核查结果。\n5.2.4.3 风险预警子系统\n5.2.4.3.1 业务分析子系统\n对风险预警分析的背景、指标、特征进行收集分析。\n5.2.4.3.2 研判子系统\n5.2.4.3.2.1 风险主题数据加工处理子系统\n风险主题数据加工处理子系统是在“互联网+监管”系统大数据中心基础上，面向风险研判和监测预警的各个应用，为风险监测应用的风险特征识别、风险预警分析、自动生成报告和展示输出提供应用数据支撑。\n风险主题的构建，主要是通过对大数据中心的投诉举报等各类数据进行加工处理，通过数据分析挖掘，进行风险研判分析，辅助人工智能等工具能力，形成数据分析结果，支撑风险处置和可视化展示。\n5.2.4.3.2.2 风险线索发现子系统\n建立监管风险线索发现机制，通过对投诉举报数据、风险预警信息进行关联、分类、聚类等分析，结合知识库发现系统性风险问题线索。如投诉举报聚焦事件，同时，可根据领导同志要求和业务需要直接指定问题线索。\n围绕重点领域、重点行业的关键监管环节和风险点，建立动态监测和预警机制。结合监管业务规则和风险因素，整合监管线索收集、查处整改等监管各环节信息以及社会信息，对各类不同渠道来源监管数据进行比对、分析、研判，及时发现宏观层面的监管薄弱环节、风险异常情况和风险线素，支撑有效防范区域性系统性、行业性监管风险。\n通用风险线索发现\n通用风险监测预警功能提供风险监测预警所需的基础分析处置流程和基础数据交互能力，协助各个风险应用点完成风险监测、风险预警和风险反馈功能。\n重点领域行业风险线索发现\n对重点领域重点行业研究风险应用特点，首先需要梳理监管业务权责、法律法规并建立风险监测围栏，并基于业务经验及数据特征，科学合理设定预警阀值。随着对重点领域行业风险特征和预警阀值的不断迭代和完善，构建一套对重点领域重点行业风险监测预警体系，全方位、动态监测重点领域重点行业各类风险特征指标。\n重热点风险事件跟踪反馈模块\n对重点行业领域，重热点风险事件进行跟踪反馈，进一步掌握事件的后续情况。包括监管工作对热点事件的影响，以及相关地方部门对热点事件相关的监管工作响应等。\n5.2.4.3.2.3 风险研判子系统\n根据风险线索所涉及领域、行业的风险特点，进行有关风险分析，制定风险判定指标体系。根据需要调用地方和部门有关数据，按照监管指标、违法指标以及行业特征指标等指标体系对各类数据资源进一步分析比对，同时结合地方和部门的风险数据研判风险性质。比如，对于负面投诉集中的问题线素，利用相关的风险分析，进行高低两级的风险分级分类研判。\n对于确定的风险预警专题，通过与地方及部门的“互联网+监管”系统数据接口，采集与风险事项相关的业务数据，通过分析研判形成风险等级与研判结论。\n风险异常指标监测预警\n风险异常指标监测预警模块通过对监管对象基本特征、经营行为、运行规律、信用历史等监管信息进行深入分析，按照监管领域、监管重点进行大数据分析，挖掘分析各类监管对象基本状态、生产经营行为与违法违规情况的内在关联性，对其主体、行为、客体、时间、空间等风险特征进行科学识别，识别和发现高风险群体，提高监管的针对性、精准性和有效性，为风险预警提供有效支撑。\n风险分类分级\n风险分级分类基于风险线索发现的结果，通过大数据挖掘方法工具，构建风险判别规则，并结合影响规模，潜在风险等等方面因素，对监管对象各种风险类别进行分类分级。风险预警系统中的风险级别有：高风险与低风险两级。\n5.2.4.3.3 可视化展示子系统\n根据研判分析输出可视化结果（按照1.5个页面算）。\n以“主题化汇聚、知识化分析、个性化服务”为原则，依托风险预警系统，充分结合大屏幕、平板电视等不同的终端特点，进行恰当的信息集成和应用，提供不同模式下的风险预警信息可视化信息展示，充分满足不同工作场景下的数据展现和利用，为领导同志宏观决策提供支撑服务。\n大屏展示\n大数据全景展示功能主要是通过今日监管、重点领域监测等功能为领导同志提供监管信息的全面展示，方便领导同志快速、高效的了解监管总体状况。可视化展示大屏能够让决策者快速掌握全局工作，强化决策服务能力，为领导同志决策层提供更方便、快捷的服务，有效提升部门办事效率。\n多维分析模块\n本区域“互联网+监管”系统大数据中心对接相关监管业务系统，实现受理信息、流转信息、处置信息共享，将许可审批、日常检查、随机抽查、联合执法、司法审判等涉企信息进行分类梳理，形成按地区、行业（许可证）、部门、处罚类型分类的数据目录，建成分类数据库，支持开展监管效能考核和数据分析，实现多维分析能力。\n5.2.5 非现场监管系统\nXXX非现场监管系统，包含区级部门的物联网监管资源、大数据监管资源和视频监管资源。要依托区集成指挥中心，评估非现场监管资源覆盖面，满足条件的随时增加接入。\n政务服务中心大厅及窗口的视频监控，是视频监管资源的重要组成部分。非现场监管系统需对接政务服务中心视频监控资源。\n5.2.6 系统对接整合\n1、与XX市“互联网+监管”系统对接\n与XX市“互联网+监管”系统进行间接对接，通过XX市“政务信息资源共享服务平台”申请获取XXX监管基础数据，并通过XX市“政务信息资源共享服务平台”实现监管行为数据上报。\n2、与XXX12345系统对接\n与XXX12345系统进行间接对接，通过XX市“政务信息资源共享服务平台”申请获取XXX投诉举报信息，并通过XX市“政务信息资源共享服务平台”实现关于投诉举报的监管行为数据上报。\n3、与XX政务服务网对接\n预留标准对接接口，根据上级要求及项目建设过程中的实际情况，随时增加系统的对接整合。\n4、与区各监管部门现有行政执法监管系统对接\n对所有涉及部门开展调研，厘清现有各类系统情况，拟定对接时间表，预留对接接口，逐一完成系统对接。\n5、与XXX政务服务平台对接\n预留标准对接接口，根据上级要求及项目建设过程中的实际情况，随时增加系统的对接整合。\n6、与市场监管信息平台对接\n预留标准对接接口，根据上级要求及项目建设过程中的实际情况，随时增加系统的对接整合。\n', 1301.19, 189.048, 'X102', '2537148609@qq.com'),
